import { BaseResourceModel } from "./base-resource.model";
export class Logradouros extends BaseResourceModel {
  constructor(id, nome, cidadesId, cidades, tiposLogradourosId, tiposLogradouros) {
    super();
    this.id = id;
    this.nome = nome;
    this.cidadesId = cidadesId;
    this.cidades = cidades;
    this.tiposLogradourosId = tiposLogradourosId;
    this.tiposLogradouros = tiposLogradouros;
  }
  static fromJson(jsonData) {
    const logradouros = {
      ...jsonData,
      tiposLogradourosId: jsonData["tiposLogradouros"]["id"],
      cidadesId: jsonData["cidades"]["id"]
    };
    return Object.assign(new Logradouros(), logradouros);
  }
  static toJson(obj) {
    delete obj['cidades'];
    return Object.assign(new Logradouros(), obj);
  }
}
